const btn = document.querySelector(".btn");

btn.addEventListener("click", () => {
  btn.classList.add("clicked");
  var date=document.getElementById('name');
  if(date.value in x)
{
    if(x[date.value].RainToday=="No")
    {
        document.getElementById("three").style.display = "none";
        document.getElementById("email").value = x[date.value].RainToday;
    }
    else
    {
        document.getElementById("three").style.display = "block";
        document.getElementById("loc").value = x[date.value].Location;
        document.getElementById("email").value = x[date.value].RainToday; 
    }
}
else
{
    alert("Please Enter a valid Date format!!!");
}
  setTimeout(() => {
    btn.classList.remove("clicked");
  }, 4000);
});
